import WeightForm from "../components/WeightForm"

export function Dashboard(){
  return(
    <div id = 'dashboard'>
      <WeightForm/>
      <h2> Weight Tracker</h2>
      <h2> A Graph </h2>
      <h2> If you lost one pound you are greater then or equal to a brick  </h2>
    </div>
  )
}
